import React, { Component } from 'react';

import '../Styles/Logo.css';

import img01 from '../images/frame0.1.png'
import img1 from '../images/frame1.png'
import img2 from '../images/frame2.jpeg'
import img3 from '../images/frame3.jpeg'
import img45 from '../images/frame4.5.png'
import img4 from '../images/frame4.jpeg'
import img5 from '../images/frame5.png'
import img6 from '../images/frame6.jpeg'
import img7 from '../images/frame7.jpg'
import img8 from '../images/frame8.png'
import img9 from '../images/frame9.png'
import img95 from '../images/frame9.5.png'



 class HucksLogo extends Component {
  state={    
        data:{
        logoImg:[
         img01,img1,img2,img3,img45
        ],
          active: img01

     }
  }



  render() {

      for  (const i of this.state.data.logoImg){
        const dataCopy = {...this.state.data};
        dataCopy.active = i;
        this.setState({
          data: dataCopy
        })

      }


    return (
      <div className="logo">
        <img src={this.state.data.active} alt="" />

      </div>
    )
  }
}


export default HucksLogo;
